description:
A preteen girl travels around the country continually stumbling over supernatural occurrences. Without anyone to believe her, she posts what she finds on her website entitled &quot;So Weird&quot;.


The show starts with Fiona Phillips, the daughter of two singers, who's been mourning the death of her father most of her life. Fi also has an obsession with all things strange, from ghosts to aliens to trolls, all of which she investigates with the help of her laptop while traveling across country on her mom's tour bus. Although her brother and friends don't believe her all of the time, Fi refuses to give up. As her search for the mysterious goes deeper, she begins to learn things about herself and, more importantly, about her father. After a few years, she passes on her quest to her friend, a promising young singer named Annie
